import React from 'react';
import './App.css';
import { Router, Switch, Route } from "react-router-dom";
import Home from "./pages/Home/Home";

type AppProps = {};

type AppState = {};

export default class App extends React.Component<AppProps, AppState> {
  constructor(props: AppProps) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      <Router>
        <Switch>
          <Route path="/home">
            <div className="App">
              <Home />
            </div>
          </Route>
        </Switch>
      </Router>
    );
  }

}
